ControlPropertyState.AutoRuleBindingString:
// Remove provider data in memory
Set (
    CurrentProviderGuid,
    Blank()
);
Set(
    CurrentProviderName,
    ""
);
Set(
    CurrentProviderEmail,
    ""
);
// Go to wizard
Navigate('Configuration Information Screen')

Refresh('IPA Processings');
Refresh('IPA Invoices');
ClearCollect(
    InvoicesToDisplay,
    AddColumns(
        Sort('IPA Processings', 'Created On', SortOrder.Descending),
        "Provider",
        'IPA Provider'.Name,
        "Invoice Number",
        'IPA Invoice'.'Invoice Number',
        "Total Amount",
        'IPA Invoice'.'Total Amount',
        "Due Date",
        'IPA Invoice'.'Due Date'
    )
);
